import React from "react";

class ShowComments extends React.Component {

    render() {
        const data = this.props.data;
        console.log(data);
        return (data && data.comments.map(item => {
            <>
                <p>{item.name}</p>
                <p>{item.comment}</p>
                <p>{item.date}</p>
            </>
        }))
    }
}

export default ShowComments;
